void FSM::runCycle() {
	/* Performs a 'run to completion' step. */
	if (isExecuting)
	{ 
		return;
	} 
	isExecuting = true;
	dispatchEvent(getNextEvent());
	do
	{ 
		doCompletion = false;
		do
		{ 
			if (completed)
			{ 
				doCompletion = true;
			} 
			completed = false;
			microStep();
			clearInEvents();
			clearInternalEvents();
			doCompletion = false;
		} while (completed);
	} while (dispatchEvent(getNextEvent()));
	isExecuting = false;
}

void FSM::enter() {
	/* Activates the state machine. */
	if (isExecuting)
	{ 
		return;
	} 
	isExecuting = true;
	/* Default enter sequence for statechart FSM */
	enseq_FSM_Festo1_Ingress_default();
	enseq_FSM_Festo1__HeightMeasurement_default();
	enseq_FSM_Festo1__Sorting_default();
	enseq_FSM_Festo1__Egress_default();
	enseq_FSM_QualityGate__Motor_default();
	enseq_FSM_Festo2__Ingress_default();
	enseq_FSM_Festo2__HeightMeasurement_default();
	enseq_FSM_Festo2__Egress_default();
	enseq_FSM_Festo2__Motor_default();
	enseq_Evaluate_default();
	enseq_FSM_Festo1__Errors_default();
	enseq_FSM_Festo2__Sorting_default();
	enseq_Festo1__FSM_LAMP_RED_default();
	enseq_Festo1__FSM_LAMP_GREEN_default();
	enseq_Festo2__FSM_LAMP_GREEN_default();
	enseq_Festo1__FSM_LAMP_YELLOW_default();
	enseq_Festo2__FSM_LAMP_RED_default();
	enseq_Festo2__FSM_LAMP_YELLOW_default();
	enseq_FSM_SystemV2_default();
	enseq_Festo2__Errors_default();
	doCompletion = false;
	do
	{ 
		if (completed)
		{ 
			doCompletion = true;
		} 
		completed = false;
		microStep();
		clearInEvents();
		clearInternalEvents();
		doCompletion = false;
	} while (completed);
	isExecuting = false;
}

